import React from 'react';
import "./products.css";
import Oculos01 from '../img/oculos01.png'
import Oculos02 from '../img/oculos02.png'
import Oculos03 from '../img/oculos03.png'
import Oculos04 from '../img/oculos04.png'

function Product() {
    return (  

            <section className='product-container'>
              <div className='limitar-secao content-container'>
              
              <div className='cards'> <h1>ﾃ田ulos de Grau</h1> <img src={Oculos01}/>      <p>R$ 500</p>  </div>
              <div className='cards'> <h1>ﾃ田ulos Transition</h1><img src={Oculos02}/>    <p>R$ 500</p></div>
              <div className='cards'> <h1>ﾃ田ulos de Sol</h1><img src={Oculos03}/>        <p>R$ 500</p></div>
              <div className='cards'> <h1>ﾃ田ulos Infantil</h1><img src={Oculos04}/>  <p>R$ 500</p></div>
               

               </div>
            </section>

    );
}

export default Product

 
;
